My test case is:

SET STORAGE GROUP TO root.turbine;
create timeseries root.turbine.d1.s0 with datatype=DOUBLE, encoding=GORILLA, compression=SNAPPY;
create timeseries root.turbine.d2.s0 with datatype=DOUBLE, encoding=GORILLA, compression=SNAPPY;
insert into root.turbine.d1(time,s0) values(4,4);
select * from root;

I will update the PR after https://github.com/apache/incubator-iotdb/pull/824 getting merged, to add timeseries checks like this:

```
        for (String path : options.getTimeseries()) {
            if (!session.checkTimeseriesExists(path)) {
                session.createTimeseries(path, TSDataType.TEXT, TSEncoding.PLAIN, CompressionType.UNCOMPRESSED);
            }
        }

```

> I will update the PR after #824 getting merged, to add timeseries checks like this:
> 
> ```
>         for (String path : options.getTimeseries()) {
>             if (!session.checkTimeseriesExists(path)) {
>                 session.createTimeseries(path, TSDataType.TEXT, TSEncoding.PLAIN, CompressionType.UNCOMPRESSED);
>             }
>         }
> ```

Hi, adding a check is ok. 

I just want to point out that from  v0.9.* on, IoTDB supports create timeseries automatically. 
Which means you can directly write "insert into..."

Two things that we need to know if we want to use the feature:

1. You need to modify the configuration file to claim which level of a path is the "storage group". It is 2 by default, which means if you write data into "root.a.b.c.e", then "root.a" is the storage group. Or, you can use `session.setStorageGroup()` to create a SG manually and then create timeseries automatically.

2. If automatically creating time series is enabled, then the data type is inferred by the first data points of a time series. e.g., if the first data is an integer, then it is long; if the first data is a float, then it is double, otherwise, it is TEXT.
